import logo from './logo.svg';
import './App.css';
import Home from './components/Home/Home';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/admin' element={<Home />} />
      </Routes>

    </div>
  );
}

export default App;
